# Menu Events
    def inspect(self):
        inspector = self.inspectorForSelectedPart()
        if inspector is None:
            return
        InspectorWindow(inspector).open()

    def pop(self):
        if len(self.inspectors) > 1:
            self.inspectors = self.inspectors[:-1]
            self.update()

    def dive(self):
        inspector = self.inspectorForSelectedPart()
        if inspector is None:
            return
        self.inspectors.append(inspector)
        self.update()
